const MedicineList = (props) => {
    console.log(props);
    console.log(props.medicineObjects)
    const medicineObjects = props.medicineObjects;
    return (

        <div>

        {medicineObjects.map(
            (obj) => (
                <div key={obj.id}>
                    <table>
                        <tr>
                            <th>Medicines</th>
                            <th>Tenure</th>
                            <th>Comments</th>
                        </tr>
                        <tr>
                            <td>{obj.medicine}</td>
                            <td>{obj.tenure}</td>
                            <td>{obj.comment}</td>
                        </tr>
                    </table>
                </div>
            )


        )}

    </div>
    );

}
export default MedicineList;
